const WriteReview = () => {


    function openPopup() {
        // 팝업 창에 표시할 콘텐츠
        var popupContent = "<h3>팝업 창 내용</h3>";
      
        // 팝업 창을 띄우기 위한 옵션
        var popupOptions = "width=400,height=300,top=100,left=100";
      
        // 팝업 창을 열기
        var popupWindow = window.open("", "_blank", popupOptions);
        
    }

    return(
        <>
        {popupWindow.document.write(popupContent)}
        </>
    )

}

export default WriteReview;
